import React from 'react';
import './App.css';
import Contact1 from './Contact1';
function App() {
  const contacts = [
    {
      avatarUrl: "https://via.placeholder.com/150",
      name: "Jenny Han",
      email: "jenny.han@notreal.com",
      age: 25
    },
    {
      avatarUrl: "https://via.placeholder.com/150",
      name: "Paul Jones",
      email: "paul.jones@notreal.com",
      age: 33
    },
    {
      avatarUrl: "https://via.placeholder.com/150",
      name: "Peter Pan",
      email: "peterpan@neverland.com",
      age: 100
    }
  ]
  return (
    <div>
      {contacts.map((contact, index)=>{
        return (
          <Contact1 
          avatarUrl={contact.avatarUrl}
          name={contact.name}
          email={contact.email}
          age={contact.age}/>
        )
      })}

      {/* <Contact1 
        avatarUrl="https://via.placeholder.com/150"
        name="Jenny Han"
        email="jenny.han@notreal.com"
        age={25}/>
      <Contact1 
        avatarUrl="https://via.placeholder.com/150"
        name="Paul Jones"
        email="paul.jones@notreal.com"
        age={55}/>
      <Contact1 
        avatarUrl="https://via.placeholder.com/150"
        name="Peter Pan"
        email="peter.pan@neverland.com"
        age={100}/> */}
    </div>

  );
}

export default App;
